import React from 'react';

import { Flex, Box } from '../../atoms/layout';

export const Clock: React.FC = () => (
	<Flex
		height="500px"
		width="500px"
		backgroundColor="reds.100"
		borderRadius="100%"
		borderStyle="solid"
		borderWidth={2}
		justifyContent="center"
		alignItems="center"
	>
		<Box height="15px" width="15px" backgroundColor="black" borderRadius="100%" />
		<Box
			height="250px"
			width="5px"
			backgroundColor="black"
			position="absolute"
			top={0}
		/>
	</Flex>
);
